const PublicationItemList = ({publications}) => {

    return (
        <div className="flex flex-col flex-nowrap items-center w-[90%] m-auto">
            {
                publications.map((publication) => {
                    return (
                        <div key={publication.id} className="cursor-pointer mb-4 rounded-[1px] bg-red-400 w-[80vw] text-center">
                            {publication.description}
                        </div>
                    );
                })
            }
        </div>
    )

}

export default PublicationItemList;
